"use strict";
const gameEngine = new GameEngine();

// start with implementing fillRectangle and FillCircle
// create movement using clear
// implement a full game

function draw_square(x, y, length, r, g, b, a) {
  for (var i = 0; i < length; i++) {
    for (var j = 0; j < length; j++) {
      gameEngine.fillPixels([[x + i,y + j]], r, g, b, a);
    }
  }
}

function draw_rectangle(x, y, height, width, r, g, b, a) {
  for (var i = 0; i < height; i++) {
    for (var j = 0; j < width; j++) {
      gameEngine.fillPixels([[x + i,y + j]], r, g, b, a);
    }
  }
}

function draw_circle_line(x, y, radius, r, g, b, a) {
  let ar = [];
  ar.push([12]);
  console.log(ar);
  var r2 = Math.pow(radius, 2);
  for (var i = 0; i <= radius; i+=0.02) {
    var i2 = Math.pow(i, 2);
    var j_diff = Math.pow(r2 - i2, 0.5);
    ar.push([x + i, y + j_diff]);
    ar.push([x - i, y + j_diff]);
    ar.push([x + i, y - j_diff]);
    ar.push([x - i, y - j_diff]);
  }
  gameEngine.fillPixels(ar, r ,g, b, a);
}

function draw_circle_filled(x,y,radius, r, g, b, a) {
  var r2 = Math.pow(radius, 2);
  let ar = [];
  for (var i = 0; i <= radius; i++) {
    var i2 = Math.pow(i, 2);
    var j_diff = parseInt(Math.pow(r2 - i2, 0.5), 10);
    ar.push([x + i, y + j_diff]);
    ar.push([x - i, y + j_diff]);
    ar.push([x + i, y - j_diff]);
    ar.push([x - i, y - j_diff]);
    for (var j = 0; j <= j_diff; j++) {
      ar.push([x + i, y + j_diff - j]);
      ar.push([x - i, y + j_diff - j]);
      ar.push([x + i, y - j_diff + j]);
      ar.push([x - i, y - j_diff + j]);
    }
  }
  gameEngine.fillPixels(ar, r ,g, b, a);
}


function draw_ball() {
  draw_circle_filled(ball_x, ball_y, ball_r, 255, 255, 255, 255);
}

function delete_ball() {
  draw_circle_filled(ball_x, ball_y, ball_r, 0, 0, 0, 0);
}

function mainLoop() {
  if (gameEngine.isKeyHeld('-')) { //'-'
    if (ball_r > 1) {
      delete_ball();
      ball_r -= 1;
      draw_ball();
    }
  }
  if (gameEngine.isKeyHeld('=')) { //'+'
    if (ball_r < Math.min(gameEngine.getScreenHeight() / 2, gameEngine.getScreenWidth() / 2)) {
      delete_ball();
      ball_r += 1;
      ball_x = Math.min(ball_x, gameEngine.getScreenWidth() - ball_r);
      ball_x = Math.max(ball_x, ball_r);

      ball_y = Math.min(ball_y, gameEngine.getScreenHeight() - ball_r);
      ball_y = Math.max(ball_y, ball_r);
      draw_ball();
    }
  }

  if (gameEngine.isKeyHeld('ArrowLeft')) {
    if (ball_x - ball_r > key_step) {
      delete_ball();
      ball_x -= key_step;
      draw_ball();
    }
    else {
      gameEngine.playSound('coin');
    }
  }
  if (gameEngine.isKeyHeld('ArrowRight')) {
    if (ball_x + ball_r < gameEngine.getScreenWidth()) {
      delete_ball();
      ball_x += key_step;
      draw_ball();
    }
    else {
      gameEngine.playSound('coin');
    }
  }
  if (gameEngine.isKeyHeld('ArrowUp')) {
    if (ball_y + ball_r < gameEngine.getScreenHeight()) {
      delete_ball();
      ball_y += key_step;
      draw_ball();
    }
    else {
      gameEngine.playSound('coin');
    }
  }

  if (gameEngine.isKeyHeld('ArrowDown')) {
    if (ball_y - ball_r > key_step) {
      delete_ball();
      ball_y -= key_step;
      draw_ball();
    }
    else {
      gameEngine.playSound('coin');
    }
  }
}



var key_step = 3;
var ball_x = 200;
var ball_y = 200;
var ball_r = 15;


gameEngine.writeParagraph('Use the arrow keys to move the ball. <br>Use -/= to increase or decrease its size.')
draw_ball();
gameEngine.startMainLoop(mainLoop);

